insert into ExternalStatement (VERSIONID, STATEMENTNAME, EXECUTIONORDER, DBCONNECTION, STATEMENT, BASEDEF) values ('DC_E_CPP:((123))', 'create view DIM_E_CPP_NE', 2, 'dwh', 'IF (SELECT count(*) FROM sys.sysviews where viewname = ''DIM_E_CPP_NE'' ) > 0 DROP VIEW DIM_E_CPP_NE BEGIN create view DIM_E_CPP_NE (OSS_ID,NE_TYPE,NE_ID,NE_NAME,NE_FDN,SITE,VENDOR,STATUS) as SELECT OSS_ID,''RNC'',RNC_ID,RNC_NAME,RNC_FDN,SITE,VENDOR,STATUS FROM DIM_E_RAN_RNC union all SELECT OSS_ID,''RBS'',RBS_ID,RBS_NAME,RBS_FDN,SITE,VENDOR,STATUS FROM DIM_E_RAN_RBS union all SELECT OSS_ID,''RXI'',RXI_ID,RXI_NAME,RXI_FDN,SITE,VENDOR,STATUS FROM DIM_E_RAN_RXI union all SELECT OSS_ID,''ERBS'',ERBS_ID,ERBS_NAME,ERBS_FDN,SITE_ID,VENDOR,STATUS FROM DIM_E_LTE_ERBS union all SELECT OSS_ID,''TDRNC'',TDRNC_ID,TDRNC_NAME,TDRNC_FDN,SITE,VENDOR,STATUS FROM DIM_E_TDRAN_TDRNC union all SELECT OSS_ID,''TDRBS'',TDRBS_ID,TDRBS_NAME,TDRBS_FDN,SITE,VENDOR,STATUS FROM DIM_E_TDRAN_TDRBS END', 0);
insert into ExternalStatement (VERSIONID, STATEMENTNAME, EXECUTIONORDER, DBCONNECTION, STATEMENT, BASEDEF) values ('DC_E_CPP:((123))', 'create view SELECT_E_CPP_AGGLEVEL', 1, 'dwh', 'IF (SELECT count(*) FROM sys.sysviews where viewname = ''SELECT_E_CPP_AGGLEVEL'') > 0 DROP VIEW SELECT_E_CPP_AGGLEVEL BEGIN create view SELECT_E_CPP_AGGLEVEL(FIRSTDATE_ID,AGGLEVEL,DATE_ID,YEAR_ID,MONTH_ID,DAY_ID,WEEK_ID,WEEKDAY_ID,BUSINESSDAY,TIMELEVEL,TIMELEVELBH,DAYS) as select FIRSTDATE_ID,AGGLEVEL,DATE_ID,YEAR_ID,MONTH_ID,DAY_ID,WEEK_ID,WEEKDAY_ID,BUSINESSDAY,TIMELEVEL,TIMELEVELBH,DAYS from dc.SELECT_AGGLEVEL_TABLE WHERE TIMELEVELBH = ''DAYBH'' commit grant select on SELECT_E_CPP_AGGLEVEL to dcbo END', 1);
